function getTimeLine() {
  /* Function for getting the tweet data on screen */

  // Creates list of nodes wof tweets
  const tweetsNodeList = document.querySelectorAll('[data-testid="tweetText"]');

  // For every node in the static node list collected
  for (let i=0; i < tweetsNodeList.length; i++){
    // Check if already analysed and skip this iteration
    if (analysedTweets.includes(tweetsNodeList[i])) {
      continue;
    }

    // If statement used to avoid nesting, 
    // else:
    analysedTweets.push(tweetsNodeList[i])

    // get tweet text
    currenttext = tweetsNodeList[i].textContent

    // Cleanse the text
    let tokenizedText = tokenizeText(currenttext)

    let paddedText = padText(tokenizedText)

    // Creates the div for the dot before any processing
    const sentimentDiv = document.createElement('div');
    sentimentDiv.classList.add('dot');

    // Check if undefined...
    if (paddedText == undefined){
      sentimentDiv.class.add("neutral");
    }

    // input to model
    // Request Server 
    fetch(url,{
      method:"POST",
      headers:{
          'Content-Type': 'application/json' // tells the server it is a json
      },
      body: JSON.stringify({
          "cleanedText":paddedText
      })
    })
    .then(res => res.json()) // Converts recieved data to a json
      .then(data => {

        // Recieves sentiment from server
        let sentiment = data["sentiment"]

        // Class colour ependant on sentiment returned from server
        if (sentiment == 0){
          sentimentDiv.classList.add('negative');  
        } else if (sentiment == 1){
          sentimentDiv.classList.add('neutral'); 
        } else if (sentiment == 2){
          sentimentDiv.classList.add('positive'); 
        }
      })
    // add relevenat subchild dot to DOM
    tweetsNodeList[i].appendChild(sentimentDiv)  
  };

  // get the tweet text from each, cleanse the data, parse through model, add relevant div with class to tweet
};

// Function for encoding the data

function tokenizeText(inpData){
  // Loop though each word in the text and encode to digit
  words = inpData.split(" ");
  var tokenizedString = ""
  var ctokenizedString = "" // Stands for current tokenizedString
  for (let i = 0; i < words.length; i++){
    words[i] = words[i].replace(/[.,\/#!$%\^&\*;:{}=\-_`~()]/g,"")
    words[i] = words[i].toLowerCase()
    ctokenizedString = WordEmbeddings[words[i]]
    if (ctokenizedString != undefined){
      tokenizedString += ctokenizedString
      tokenizedString += " "
    }
  }
  return tokenizedString
}

function padText(inpText){
  // Current shape of model is 31 indexes. So add 0s to the front of data until it is 31 long
  const SHAPE = 31
  indexes = inpText.split(" ")
  indexes.pop() //  A "" index would always be added to the end of the list
  zeroNum = SHAPE - indexes.length
  // Add calculated number of zeros to the front of the indexs list
  if (zeroNum < 0 ){
    // The case when there are more than 31 correctly identified words
    // Correct analysis cannot occur so display a neutral
    return undefined
  }
  for (let i = 0; i < zeroNum; i++){
    indexes.unshift("0")
  }
  return indexes
}
  
